import React from 'react';
import Image from 'react-bootstrap/Image';

class ResidentPhoto extends React.Component {
    render() {
        return (
          <form classname="container" formtext-padding="10 px">
            <div className="container">
                <p>Photo:</p>
                <Image src="data:image/jpeg;base64," thumbnail margin="10px"/> 
            </div>
          </form>
        );
      }
  }

  export default ResidentPhoto;
